public void initValue()
{
    if (this.CurrencyCode == '')
    {
        this.CurrencyCode = CompanyInfoHelper::standardCurrency();
    }

    super();
}

public void defaultField(FieldId _fieldId)
{
    TMSCarrierAccessorial carrierAccessorial;
    TMSHubAccessorial hubAccessorial;

    super(_fieldId);

    switch (_fieldId)
    {
        case fieldNum(TMSAccessorialAssignment, CarrierAccessorialId):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, CarrierCode))
                && this.CarrierCode == '')
            {
                this.CarrierAccessorialId = '';
            }
            break;

        case fieldNum(TMSAccessorialAssignment, HubAccessorialId):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, HubMasterCode))
                && this.HubMasterCode == '')
            {
                this.HubAccessorialId = '';
            }
            break;

        case fieldNum(TMSAccessorialAssignment, AccessorialMasterCode):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, CarrierAccessorialId)))
            {
                carrierAccessorial = TMSCarrierAccessorial::find(this.CarrierAccessorialId);
                this.AccessorialMasterCode = carrierAccessorial.AccessorialMasterCode;
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, HubAccessorialId)))
            {
                hubAccessorial = TMSHubAccessorial::find(this.HubAccessorialId);
                this.AccessorialMasterCode = hubAccessorial.AccessorialMasterCode;
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, CarrierCode)))
            {
                if (this.CarrierCode == '')
                {
                    this.AccessorialMasterCode = '';
                }
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, HubMasterCode)))
            {
                if (this.HubMasterCode == '')
                {
                    this.AccessorialMasterCode = '';
                }
            }
            break;

        case fieldNum(TMSAccessorialAssignment, ExternalCode):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, CarrierAccessorialId)))
            {
                carrierAccessorial  = TMSCarrierAccessorial::find(this.CarrierAccessorialId);
                this.ExternalCode    = carrierAccessorial.ExternalCode;
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, HubAccessorialId)))
            {
                hubAccessorial = TMSHubAccessorial::find(this.HubAccessorialId);
                this.ExternalCode    = hubAccessorial.ExternalCode;
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, CarrierCode)))
            {
                if (this.CarrierCode == '')
                {
                    this.ExternalCode = '';
                }
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, HubMasterCode)))
            {
                if (this.HubMasterCode == '')
                {
                    this.ExternalCode = '';
                }
            }
            break;

        case fieldNum(TMSAccessorialAssignment, BillingGroupId):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, CarrierAccessorialId)))
            {
                carrierAccessorial = TMSCarrierAccessorial::find(this.CarrierAccessorialId);
                this.BillingGroupId = carrierAccessorial.BillingGroupId;
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, HubAccessorialId)))
            {
                hubAccessorial = TMSHubAccessorial::find(this.HubAccessorialId);
                this.BillingGroupId = hubAccessorial.BillingGroupId;
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, CarrierCode)))
            {
                if (this.CarrierCode == '')
                {
                    this.BillingGroupId = '';
                }
            }
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, HubMasterCode)))
            {
                if (this.HubMasterCode == '')
                {
                    this.BillingGroupId = '';
                }
            }
            break;

        case fieldNum(TMSAccessorialAssignment, CarrierServiceCode):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, CarrierAccessorialId)))
            {
                carrierAccessorial = TMSCarrierAccessorial::find(this.CarrierAccessorialId);
                this.CarrierServiceCode = carrierAccessorial.CarrierServiceCode;
            }
            break;

        case fieldNum(TMSAccessorialAssignment, HubPosition):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, HubAccessorialId)))
            {
                hubAccessorial = TMSHubAccessorial::find(this.HubAccessorialId);
                this.HubPosition = hubAccessorial.HubPosition;
            }
            break;

        case fieldNum(TMSAccessorialAssignment, InventLocationId):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, InventSiteId)))
            {
                this.InventStorageDimMap::modifiedField(fieldNum(InventStorageDimMap, InventSiteId));
            }
            break;

        case fieldNum(TMSAccessorialAssignment, InventSiteId):
            if (this.isFieldSet(fieldNum(TMSAccessorialAssignment, InventLocationId)))
            {
                this.InventStorageDimMap::modifiedField(fieldNum(InventStorageDimMap, InventLocationId));
            }
            break;
    }
}

