public boolean validateField(FieldId _fieldIdToCheck)
{
    boolean ret;

    ret = super(_fieldIdToCheck);

    switch (_fieldIdToCheck)
    {
        case fieldNum(TMSAccessorialAssignment, InventLocationId):
            ret = this.InventStorageDimMap::validateField(fieldNum(InventStorageDimMap, InventLocationId));
            break;
    }

    return ret;
}

public boolean validateWrite()
{
    boolean ret;

    ret = super();

    if ((this.FeeType == TMSFeeType::FuelSurcharge || this.FeeType == TMSFeeType::PerUOM || this.FeeType == TMSFeeType::Percent)
        && !this.uom)
    {
        ret = checkFailed(strFmt("@SYS116347", "@TRX372"));
    }

    if (this.FeeType == TMSFeeType::FuelSurcharge && this.FuelIndexRegionCode == '')
    {
        ret = checkFailed(strFmt("@SYS116347", "@TRX487"));
    }

    if (this.CarrierCode && !this.CarrierAccessorialId)
    {
        ret = checkFailed(strFmt("@SYS116347", "@TRX1132"));
    }

    if (this.HubMasterCode && !this.HubAccessorialId)
    {
        ret = checkFailed(strFmt("@SYS116347", "@TRX1134"));
    }

    ret = ret
        && this.validateZoneMaster()
        && this.validateFilterFields();

    return ret;
}

private boolean validateZoneMaster()
{
    boolean ret = true;

    if (this.ZoneMasterCode
        && TMSZoneMaster::find(this.ZoneMasterCode).ZoneType != TMSZoneType::Routing)
    {
        ret = checkFailed("@TRX:MessageError_NonRoutingZoneTypeForZoneMaster");
    }

    if (this.Zone)
    {
        TMSZoneMasterDetail zoneMasterDetail;
        select firstonly RecId from zoneMasterDetail
            where zoneMasterDetail.ZoneMasterCode == this.ZoneMasterCode
                && zoneMasterDetail.Zone == this.Zone;

        if (!zoneMasterDetail.RecId)
        {
            ret = checkFailed("@TRX:MessageError_ZoneCriterionDoesNotExistInZoneMaster");
        }
    }

    return ret;
}

private boolean validateFilterFields()
{
    boolean ret = true;

    boolean isAnyShippingCarrierFieldSet = this.CarrierAccessorialId || this.CarrierCode;
    boolean isAnyHubFieldSet = this.HubAccessorialId || this.HubMasterCode;

    if (isAnyHubFieldSet)
    {
        if (isAnyShippingCarrierFieldSet)
        {
            ret = checkFailed("@TRX:MessageError_ShippingCarrierAndHubSpecified");
        }

        if (this.State
            || this.CountryRegion
            || this.PostalCodeHigh
            || this.PostalCodeLow
            || this.ZoneMasterCode
            || this.Zone)
        {
            ret = checkFailed("@TRX:MessageError_AddressFieldsCriteriaSpecifiedOnHubSpecificAssignment");
        }
    }

    if (this.CarrierAccessorialId
        && TMSCarrierAccessorial::find(this.CarrierAccessorialId).CarrierCode != this.CarrierCode)
    {
        ret = checkFailed("@TRX:MessageError_ShippingCarrierAccessorialChargeDoesNotExistForSpecifiedShippingCarrier");
    }

    if (this.HubAccessorialId
        && TMSHubAccessorial::find(this.HubAccessorialId).HubMasterCode != this.HubMasterCode)
    {
        ret = checkFailed("@TRX:MessageError_HubAccessorialChargeDoesNotExistForSpecifiedHub");
    }

    return ret;
}

public static boolean exist(RecId   _recId)
{
    return (_recId) &&
           (select firstonly tmsAccessorialAssignment
                where tmsAccessorialAssignment.RecId == _recId).RecId != 0;
}

public static TMSAccessorialAssignment find(RecId   _recId,
                                            boolean _forupdate = false)
{
    TMSAccessorialAssignment    tmsAccessorialAssignment;

    if (_recId)
    {
        tmsAccessorialAssignment.selectForUpdate(_forupdate);

        select firstonly tmsAccessorialAssignment
            where tmsAccessorialAssignment.RecId == _recId;
    }

    return tmsAccessorialAssignment;
}

static void lookupCarrierAccessorial(FormStringControl _ctrl, TMSCarrierCode _carrierCode)
{
    SysTableLookup          sysTableLookup;
    Query                   query;
    QueryBuildDataSource    queryBuildDataSource;

    if (_carrierCode)
    {
        sysTableLookup          = SysTableLookup::newParameters(tableNum(TMSCarrierAccessorial), _ctrl);
        query                   = new Query();
        queryBuildDataSource    = query.addDataSource(tableNum(TMSCarrierAccessorial));

        sysTableLookup.addLookupfield(fieldNum(TMSCarrierAccessorial, CarrierAccessorialId));
        sysTableLookup.addLookupfield(fieldNum(TMSCarrierAccessorial, CarrierCode));
        sysTableLookup.addLookupfield(fieldNum(TMSCarrierAccessorial, CarrierServiceCode));
        sysTableLookup.addLookupfield(fieldNum(TMSCarrierAccessorial, AccessorialMasterCode));
        sysTableLookup.addLookupfield(fieldNum(TMSCarrierAccessorial, ExternalCode));
        sysTableLookup.addLookupfield(fieldNum(TMSCarrierAccessorial, BillingGroupId));
        queryBuildDataSource.addRange(fieldNum(TMSCarrierAccessorial, CarrierCode)).value(queryValue(_carrierCode));

        sysTableLookup.parmQuery(query);
        sysTableLookup.performFormLookup();
    }
}

