/// <summary>
/// Retrieves list of accessorial assignments applicable for particular accessorial shipment processing.
/// </summary>
/// <param name = "_accessorialShipData">Payload for accessorial charge processing</param>
/// <param name = "_ratingDto">Rating DTO.</param>
/// <returns>A list of records in <c>TMSAccessorialAssignment</c>; otherwise an empty list.</returns>
/// <remarks>Add a post-method handler for returning the right list when extending the <c>TMSHubPosition</c> enumeration.</remarks>
public static List getAccessorialAssignmentList(TMSFwkAccessorialShipData _accessorialShipData, RatingDto _ratingDto)
{
    List result = new List(Types::Record);
    TMSAccessorialAssignment accessorialAssignment;
    TMSScheduledShipUTCDateTime unspecifiedDateTime = DateTimeUtil::newDateTime(dateNull(), 0);
    TMSScheduledShipUTCDateTime effectiveDateTime = _accessorialShipData.getEffectiveScheduledShipDateTime();

    while select accessorialAssignment
        where
            (
                (_ratingDto.CarrierCode != '' && accessorialAssignment.CarrierCode == _ratingDto.CarrierCode)
                || (_accessorialShipData.parmPickupHubMasterCode() != '' && accessorialAssignment.HubMasterCode == _accessorialShipData.parmPickupHubMasterCode() && accessorialAssignment.HubPosition == TMSHubPosition::PickUp)
                || (_accessorialShipData.parmDropOffHubMasterCode() != '' && accessorialAssignment.HubMasterCode == _accessorialShipData.parmDropOffHubMasterCode() && accessorialAssignment.HubPosition == TMSHubPosition::DropOff)
            )
            &&
            (
                (accessorialAssignment.AlwaysApply == NoYes::Yes)
                ||
                (
                    (accessorialAssignment.CarrierServiceCode == '' || accessorialAssignment.CarrierServiceCode == _ratingDto.CarrierServiceCode)
                    && (accessorialAssignment.CustomerInvoiceCode == '' || accessorialAssignment.CustomerInvoiceCode == _accessorialShipData.parmCustomerInvoiceCode())
                    && (accessorialAssignment.CustomerCode == '' || accessorialAssignment.CustomerCode == _accessorialShipData.parmCustomerCode())
                    && (accessorialAssignment.InventSiteId == '' || accessorialAssignment.InventSiteId == _accessorialShipData.parmSite())
                    && (accessorialAssignment.InventLocationId == '' || accessorialAssignment.InventLocationId == _accessorialShipData.parmWarehouse())
                    && accessorialAssignment.WeightLow <= _accessorialShipData.parmWeight()
                    && (accessorialAssignment.WeightHigh >= _accessorialShipData.parmWeight() || accessorialAssignment.WeightHigh == 0)
                    && (accessorialAssignment.PostalCodeLow == '' || accessorialAssignment.PostalCodeLow <= _accessorialShipData.parmPostalCode())
                    && (accessorialAssignment.PostalCodeHigh == '' || accessorialAssignment.PostalCodeHigh >= _accessorialShipData.parmPostalCode())
                    && (accessorialAssignment.State == '' || accessorialAssignment.State == _accessorialShipData.parmState())
                    && (accessorialAssignment.CountryRegion == '' || accessorialAssignment.CountryRegion == _accessorialShipData.parmCountry())
                    && accessorialAssignment.ValueLow <= _accessorialShipData.parmValue()
                    && (accessorialAssignment.ValueHigh >= _accessorialShipData.parmValue() || accessorialAssignment.ValueHigh == 0)
                    && (accessorialAssignment.FreightTermCode == '' || accessorialAssignment.FreightTermCode == _accessorialShipData.parmFreightTermsCode())
                    && (_accessorialShipData.parmResidential() == '' || accessorialAssignment.Residential == symbol2Enum(enumNum(NoYes), _accessorialShipData.parmResidential()))
                    && (accessorialAssignment.EquipmentCode == '' || accessorialAssignment.EquipmentCode == _accessorialShipData.parmEquipmentCode())
                    && (accessorialAssignment.EffectiveUTCDateTimeFrom <= effectiveDateTime || accessorialAssignment.EffectiveUTCDateTimeFrom == unspecifiedDateTime)
                    && (accessorialAssignment.EffectiveUTCDateTimeTo >= effectiveDateTime || accessorialAssignment.EffectiveUTCDateTimeTo == unspecifiedDateTime)
                )
            )
    {
        result.addEnd(accessorialAssignment);
    }

    return result;
}

